import logo from './assets/logo.svg';
import redacted from './assets/redacted.jpg'
import flowerPeople from './assets/flower-people.jpg';
import blueprint from './assets/blueprint.jpg';
import blueprintFront from './assets/blueprint-front-facing.jpg';
import hongKong from './assets/hong-kong.jpg';
import atoll from './assets/atoll.jpg';
import atollCharcoal from './assets/atoll-charcoal.jpg';
import threeWiseFools from './assets/three-wise-fools.jpg';
import dragonMap from './assets/dragon-map.jpg';
import kitchenTable from './assets/banks-street-kitchen-table.jpg'
import kitchenShelves from './assets/banks-street-kitchen-shelves.jpg'
import kittyLove from './assets/kitty-love.jpg'
import lessOfAStrangerBlack from './assets/less-of-a-stranger-black.jpg'
import lessOfAStrangerGold from './assets/less-of-a-stranger-gold.jpg'
import waterTiles from './assets/water-tiles.jpg'
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="headerContainer">
        <img src={logo} className="logo"/>
        <div className="header">
          <span className="bio">
            Eva Lau is an (avid, active, etc) artist and (occasional) programmer in nyc.
            {/* <sup className="bioDesc"><i> (Mainly, however, she seems to just enjoy making things that make her happy.)</i></sup> */}
          </span>
          {/* <span>
            {' '}She loves tactile goods, textures/patterns, socially responsible computing.
          </span> */}
          <i> (Mainly, however, she seems to just enjoy making things that make her happy.)</i>
        </div>
      </div>
      <div>
       <p className="warning">this site is under construction, but it welcomes all visitors :)</p>
      </div>
      <div>
        <img src={redacted} className='defaultPhoto photoGreen'/>
        <img src={flowerPeople} className='defaultPhoto photoRed'/>
        <img src={waterTiles} className='defaultPhoto photoBlue'/>
        <img src={blueprint} className='defaultPhoto photoGreen'/>
        <img src={blueprintFront} className='defaultPhoto photoGreen'/>
        <img src={hongKong} className='defaultPhoto photoBlue'/>
        <img src={atoll} className='defaultPhoto photoRed'/>
        <img src={atollCharcoal} className='defaultPhoto photoRed'/>
        <img src={threeWiseFools} className='defaultPhoto photoBlue'/>
        <img src={dragonMap} className='defaultPhoto photoRed'/>
        <img src={kitchenTable} className='defaultPhoto photoGreen'/>
        <img src={kitchenShelves} className='defaultPhoto photoGreen'/>
        <img src={kittyLove} className='defaultPhoto photoBlue'/>
        <img src={lessOfAStrangerBlack} className='defaultPhoto photoRed'/>
        <img src={lessOfAStrangerGold} className='defaultPhoto photoRed'/>
      </div>
    </div>
  );
}

export default App;
